import React, { useRef } from 'react';
import Homescreen from './Pages/Home/Homescreen';
import AboutMe from './Pages/Home/AboutMe';
import Experience from './Pages/Home/Experience';
import Projects from './Pages/Home/Projects';
import './styles.css'; // Import the CSS file

const Sections = () => {
  const homeRef = useRef(null);
  const aboutRef = useRef(null);
  const experienceRef = useRef(null);
  const projectsRef = useRef(null);

  const scrollToSection = (ref) => {
    ref.current.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <div>
      <button className="scroll-button" onClick={() => scrollToSection(homeRef)}>Home</button>
      <button className="scroll-button" onClick={() => scrollToSection(aboutRef)}>About</button>
      <button className="scroll-button" onClick={() => scrollToSection(experienceRef)}>Experience</button>
      <button className="scroll-button" onClick={() => scrollToSection(projectsRef)}>Projects</button>

      <div ref={homeRef}><Homescreen /></div>
      <div ref={aboutRef}><AboutMe /></div>
      <div ref={experienceRef}><Experience /></div>
      <div ref={projectsRef}><Projects /></div>
    </div>
  );
};

export default Sections;
